INSERT INTO `pat_item` (`id_item`, `id_nivel`, `id_seccion`, `correlativo_item`, `descripcion_item`, `id_padre`, `fecha_creacion`, `id_usuario_crea`, `fecha_modificacion`, `id_usuario_modifica`) VALUES
(68, 18, 22, 'OE1', 'Promover oportunidades de acceso a Empleo digno.', NULL, '2015-06-05 04:29:07', 22, '2015-07-07 09:45:03', 20),
(69, 18, NULL, 'OE2', 'Garantizar la efectiva verificación del cumplimiento de los derechos laborales y condiciones de trabajo digno.', NULL, '2015-06-05 04:29:07', 22, '2015-06-10 20:59:57', 22),
(70, 18, NULL, 'OE3', 'Fortalecer los mecanismos e instrumentos de diálogo entre sector empleador, trabajadoras y trabajadores.', NULL, '2015-06-05 04:29:07', 22, '2015-06-10 20:59:57', 22),
(71, 18, NULL, 'OE4', 'Contribuir a que el Estado Salvadoreño cumpla con los tratados internacionales en materia laboral.', NULL, '2015-06-05 04:29:07', 22, '2015-06-10 20:59:57', 22),
(72, 18, NULL, 'OE5', 'Posicionar al MTPS como una institución moderna, centrada en la gestión de servicios laborales de calidad, calidez, incluyentes e igualitarios.', NULL, '2015-06-05 04:29:07', 22, '2015-06-14 18:49:45', 22),
(73, 19, 42, 'R1.OE1', 'Implementado el Sistema Nacional de Empleo, promoviendo el acceso a empleos.', 68, '2015-06-05 04:30:28', 22, '2015-10-22 09:14:21', 30),
(74, 19, 42, 'R2.OE1', 'Promovida la cultura de prevención de riesgos ocupacionales con perspectiva de género.', 68, '2015-06-05 04:30:28', 22, '2015-10-22 09:15:23', 30),
(75, 19, 37, 'R3.OE2', 'Inspecciones centradas en trabajadoras y trabajadores y en la garantía de la tutela de sus derechos fundamentales, coadyuvante al logro de un trabajo digno.', 69, '2015-06-05 04:30:28', 22, '2015-10-22 09:17:28', 30),
(76, 19, 43, 'R4.OE3', 'Se cuenta con un mecanismo de asesoría de derechos laborales colectivos para las Organizaciones sindicales.', 70, '2015-06-05 04:30:28', 22, '2015-10-22 09:19:32', 30),
(77, 19, 43, 'R5.OE3', 'Fomentadas relaciones laborales respetuosas de los derechos entre personas empleadoras y trabajadoras.', 70, '2015-06-05 04:30:28', 22, '2015-10-22 09:21:11', 30),
