(449, 202, 6, 2016, 1, 0, 'Sistemas Internos -->  Intranet: Generación de respaldo semanal de sitio web y su base de datos. SNIT: Se realizó respaldo de la base de datos y sistema. Soporte permanente a los usuarios del sistema.  Se realizarón reuniones con la Secretaria Técnica de la Presidencia de la República, para continuar con la exposición de la nueva versión adaptada por los técnicos designados de esa institución. Se brindo apoyo a la Secretaria Técnica de la Presidencia de la República. Renacempleo: Se realizó respaldo del sistema y base de datos. Se realizó mantenimiento y soporte permanente a los usuarios del sistema. Aumento de memoria para ejecución del Jbbos. Capacitación al personal de Auditoría Interna. Generación de Consultas para la oficina de Auditoria. Generación de reporte de personas naturales que cuentan con diligencias de inspección. Informe sobre visita a Oficina de San Vicente sobre funcionalidad del sistema. \nRenacempleo: Se realizó respaldo del sistema y base de datos. Se realizó mantenimiento y soporte permanente a los usuarios del sistema. Generación de consulta a la Oficina de Estadística. \nSistemas Externos -->  Sitio Web Institucional: Generación de respaldo semanal de sitio web y su base de datos. PNE: Soporte permanente a los usuarios del sistema. Depuración de datos generados de prueba. Mantenimiento del servidor de aplicaciones. SNNAT: Soporte permanente a los usuarios del sistema.', '2016-09-16 10:13:29', 912, NULL, NULL),
