(454, 209, 6, 2016, 1, 0, 'Se desarrolló primera versión de la herramienta para registrar el plan de capacitaciones institucional, se ha mantenido un formato similar al utilizado en la evaluación del desempeño con variantes propias de la herramienta utilizada en la nueva versión. Se utilizó una herramienta libre que puede ser accedida desde cualquier dispositivo con acceso a internet.', '2016-09-16 10:13:29', 912, NULL, NULL),
(455, 210, 6, 2016, 1, 0, 'Se desarrolló primera versión de la herramienta para medir el clima laboral, la misma es conforme al formato obtenido del departamento de RRHH durante el año 2015. Se utilizó una herramienta libre que puede ser accedida desde cualquier dispositivo con acceso a internet.', '2016-09-16 10:13:29', 912, NULL, NULL),
