(2066, 1368, 2, 2017, 1, 0, 'Actividades realizadas: Se apoyo la tarea de implementación de antivirus Sophos Endpoint Security. Se brindó capacitación básica a compañeros de la unidad de desarrollo tecnológico en la instalación de antivirus nuevo así como la administración del mismo. Se apoyo en configuración de equipo de almacenamiento SAN en la configuración y actualización de los mismo. Instalación  y configuración de servidor virtual para nueva Intranet.', '2017-03-07 14:27:13', 868, '2017-03-08 10:40:47', 868),
(2067, 1370, 2, 2017, 26, 0, 'Se realizaron 26 mantenimientos a computadoras de escritorio de las dependencias: Oficina de Auditoria y Control Interno, Sección de Multas, Oficina de Coordinación y Desarrollo Institucional, Depto. Nacional de Empleo, UACI. El jefe de la Unidad expresó que no se alcanzó el 100% de cumplimiento debido a la realización de las siguientes actividades:Atención prioritaria en Instalación y configuración de nuevas computadoras y sus servicios en la UFI y la consecuente reasignación de equipos en otras áreas como RRHH, DGPS, DGIT, Oficina Regional de Zacatecoluca. Instalación y configuración de consolas y actualización de antivirus en Oficinas Regionales y Departamentales. Capacidad disminuida en cuanto a RRHH.', '2017-03-07 14:36:52', 868, '2017-03-13 10:14:06', 868),
