(2116, 1366, 2, 2017, 1, 0, 'Se realizaron tres jornada de capacitacíon tipo taller, sobre los módulos: Aprobación de reglamentos y conciliación individual con un total de 21 personas capacitadas. El sistema se ha probado desde los equipos de los usuarios.', '2017-03-08 10:44:10', 868, NULL, NULL),
