(5423, 1368, 6, 2017, 1, 0, 'Verificación de licencia e instalación de antivirus Sophos Endpoint en el Centro Recreativo Coatepeque en 20 equipo del centro capacitación. Verificación y reconfiguración del servicio de internet en oficina departamental de Chalatenango.  	Reconfiguración de Switch en el segundo nivel del edificio 2 en Oficinas Centrales, debido a fallas del servicio eléctrico. Verificación de equipo de seguridad Perimetral UTM Sophos, debido al vencimiento de licenciamiento y obtención de última fecha que se tendrá la administración y control de equipo. Apoyo vía telefónica para configuración de cliente de correo electrónico en Oficina Paracentral de Zacatecoluca. Instalación de 2 puntos adicionales de computadora portatil y ploter. Traslado de punto de red Jefa Supervisoria 3 Licda. Reina Velazco.', '2017-07-10 10:44:53', 868, '2017-07-10 14:05:57', 868),
