(6111, 1368, 7, 2017, 1, 0, 'Apoyo en la limpieza de los equipo de aires acondicionado de precisión de la sala de servidores.  Apoyo en la implementación de nuevo Sistema de Almacenamiento de Información. Configuración de nuevo servidor de virtualización con nuevo espacio de almacenamiento. Configuración de nuevo espacio de almacenamiento para respaldo  de servidor de Base de Datos SNIT. Gestión para que el correo institucional mtrabajo.mtps.gob.sv fuera sacado de lista negra o bloqueo de correo.\nCreación de nuevas reglas en equipo de seguridad perimetral,  para evitar el ingreso no autorizado al correo institicional. Reconfiguración del servidor principal de Active Directory, debido a fallas de replicación de información. Reconfiguración del servidor de réplica de Active Directory debido a fallos de servidor principal. Eliminación de correos Spam en servidor de correo institucional, debido a que el servicio se bloqueó. Reconfiguración nueva IP publica del servidor de correo institucional, debido a los problemas de correos Spam.', '2017-08-16 13:59:27', 868, NULL, NULL),
(6112, 1369, 7, 2017, 135, 0, 'Se realizaron los siguientes soportes por zona geográfica: Zona Central=61, Zona Occidental=54 y Zona Oriental=20. Un total de 135 soportes técnicos.', '2017-08-16 14:01:13', 868, NULL, NULL),
