(6114, 1386, 7, 2017, 1, 0, 'Gestión para financiar ajustes a la herramienta  de Inteligencia de Negocios. Se espera dar inicio a las mejoras en el mes de septiembre de 2017. ', '2017-08-16 14:20:39', 868, '2017-08-16 15:12:40', 868),
(6115, 1656, 7, 2017, 1, 0, 'Gestión para que el correo institucional mtrabajo.mtps.gob.sv fuera sacado de lista negra o bloqueo de correo. La nueva Intranet fue puesta en marcha a partir del viernes 21 de julio de 2017. Soporte permanente a personas\nusuarias. Realización de respaldo de\ncarpeta del sistema y de la base de\ndatos.\nInstalación  de extesion Telefonica en paralelo (5 MTS.)  ext. 3888.', '2017-08-16 14:24:12', 868, '2017-08-16 14:30:49', 868),
