(6119, 1657, 7, 2017, 1, 0, '-Se ha brindado soporte a los sistemas administrativos  de uso interno (SIB, SAF, SNNAT, STCOM, SFERH) en procesos como: Ajustes a reportes, incidencias menores de usurios y reesttablecimiento de claves entre otros. -Se continuo haciendo gestión con el Sr. Douglas Morales  enviado de la UES, a fin de continuar con el proceso de depuración e implementación del SISRICAR. -Se desplegó el sistema en un servidor de aplicaciones con sistema operativo CentOS (Linux / libre) sin embargo hubo incindencias que no permitieron la puesta en producción. Se usará otra distribución en la que ya ha sido probado el sistema con el fin de tenerlo en producción durante el mes de agosto de 2017. -Se continuo haciendo gestión con el Sr. Douglas Morales,  enviado de la UES, a fin de continuar con el proceso de depuración e implementación del SIGAP. -Se desarrollaron sesiones de capacitación con el personal de la UACI, adicionalmente se hicieron ajustes en los procesos: registro de solicitudes de compra, registro de productos y se finalizo el módulo de registro de equipo informático vinculado al registro de activos fijos.-Sistema Nacional de Inspecciones de Trabajo (versión nueva): Respaldo de la base de datos y sistema. Soporte permanente a los usuarios. Actualización en base de datos en las tabla Infracciones. 3 Informes del uso del sistema. Programación de dos mantenimientos para realizar automáticamente el full backup y un backup diferencial. -Sistema Nacional de Inspecciones de Trabajo (versión antigua): Respaldo de la base de datos y sistema. Soporte permanente a los usuarios. 1 Informes del uso del sistema. Programación de dos mantenimientos para realizar automáticamente el full backup y un backup diferencial. -Sistema de Intermediación de Empleo (Renacemepleo):  Respaldo de la base de datos y sistema. Soporte permanente a los usuarios. -Sistema Nacional de Empleo: Respaldo de la base de datos y sistema. Soporte permanente a los usuarios. Entrega a la Oficina de Empleo Reporte de vinculación online mes de julio. -Sistema Nacional de Notificaciones de Accidentes: Respaldo de la base de datos y sistema. Soporte permanente a los usuarios.  de la base de datos y sistema. -Sitio Web Institucional: Soporte permanente a personas usuarias. Realización de respaldo de carpeta del sistema y de la base de datos.', '2017-08-16 15:15:24', 868, '2017-08-16 15:15:44', 868),
