(6644, 1368, 8, 2017, 1, 0, 'Se realizó instalación del software SPSS en un nuevo servidor, debido a que el servidor que lo alojaba presentó dejó de funcionar. Se creó reglas de navegación en equipo UTM Sophos para la implemenanción del nuevo contrato del  Se apoyó en el restablecimiento del servicio de Internet  en la Oficina Paracentral de Zacatecoluca, La Paz. Se realizó configuración de respaldo automático de carpetas compartidas, servicio que se brinda a: Unidad para la Equidad entre los Géneros, Centros de Recreación para Trabajadoras y Trabajadores, Oficia de Asesoría Jurídica. Se apoyó en la configuración de VPN desde Centro de Recreación a Trabajadoras y Trabajadores El Tamarindo hacia la Oficina Regional de San Miguel, para obtener marcaciones de reloj y actualización de antivirus. Se creó mapa de instalación y configuración de nuevos switchs.', '2017-09-11 10:03:44', 868, '2017-09-11 14:15:46', 868),
