(6743, 1656, 8, 2017, 1, 0, 'Intranet: Soporte permanente a personas usuarias. Realización de respaldo de carpeta del sistema y de la base de datos.', '2017-09-12 15:30:46', 868, '2017-09-12 15:34:14', 868),
(6744, 1657, 8, 2017, 1, 0, 'Se ha brindado soporte a los sistemas administrativos  de uso interno (SIB, SAF, SNNAT, STCOM, SFERH) en procesos como: Ajustes a reportes, incidencias menores de usuarios y reestablecimiento de claves entre otros. Sistema Informático para el Seguimiento de Resolución de Conflictos y Aprobación de Reglamentos Internos de Trabajo: Se continuo haciendo pruebas con el Sr. Douglas Morales,  para depurar errores e implementar el proyecto SISRICAR. Sistema de Registro de Contratos Individuales de Trabajo: Se desplegó el sistema en un servidor de aplicaciones con sistema operativo UBUNTU Server. Se mejoro la pantalla de de acceso. Sistema de Gestión de Asociaciones Profesionales: Se continuo haciendo pruebas con el Sr. Douglas Morales,  para depurar errores e implementar el proyecto SIGAP. Sistema de Procesos Administrativos (Compras - Bodega - Activo Fijo): Se desarrollaron sesiones de capacitación con el personal de la UACI, adicionalmente se hicieron ajustes en los procesos: Registro de solicitudes de compra, registro de productos y se finalizo el módulo de registro de equipo informático vinculado al registro de activos fijos. Sistema Nacional de Inspecciones de Trabajo (versión nueva): Se realizó respaldo de la base de datos y sistema. Soporte  a los usuarios. Informe de Problemas de uso SNIT, Presentación descriptiva del SNIT. Sistema Nacional de Inspecciones de Trabajo (versión antigua): Se realizó respaldo de la base de datos y sistema. Soporte a los usuarios. Sistema de Intermediación de Empleo (Renacemepleo): Se realizó respaldo de la base de datos y sistema. Soporte a los usuarios. Realización de encuesta de  la ley general Seguridad y Salud Ocupacional. \nSistema Nacional de Empleo: Se realizó respaldo de la base de datos y sistema. Soporte a los usuarios. Entrega a la oficina de empleo Reporte de Vinculación Online mes de Julio. Sistema Nacional de Notificaciones de Accidentes: Se realizó respaldo de la base de datos y sistema. Soporte permanente a los usuarios del sistema. Sitio Web Institucional: Soporte permanente a personas usuarias. Realización de respaldo de carpeta del sistema y de la base de datos.', '2017-09-12 15:32:19', 868, '2017-09-12 15:33:22', 868),
